#!/usr/bin/env python3
import importlib
import importlib.abc
import importlib.util
import io
import os
import sys
import zipfile
import base64

_BUNDLE_CACHE = None
_BUNDLE_MODULE_MAP = None
_BUNDLE_FILE_MAP = None
_BUNDLE_B64 = ""
_BUNDLE_BUILDING = False


def _read_bundle_bytes() -> bytes:
    global _BUNDLE_CACHE
    if _BUNDLE_CACHE is not None:
        return _BUNDLE_CACHE
    if not _BUNDLE_B64:
        raise RuntimeError("bundle payload not found")
    _BUNDLE_CACHE = base64.b64decode(_BUNDLE_B64.encode("ascii"))
    return _BUNDLE_CACHE


def _open_bundle_zip() -> zipfile.ZipFile:
    return zipfile.ZipFile(io.BytesIO(_read_bundle_bytes()), "r")


def _build_bundle_maps():
    global _BUNDLE_MODULE_MAP, _BUNDLE_FILE_MAP, _BUNDLE_BUILDING
    if _BUNDLE_MODULE_MAP is not None and _BUNDLE_FILE_MAP is not None:
        return
    if _BUNDLE_BUILDING:
        return
    _BUNDLE_BUILDING = True
    module_map = {}
    file_map = {}
    try:
        with _open_bundle_zip() as zf:
            for name in zf.namelist():
                if not name.lower().endswith(".py"):
                    continue
                base = name.split("/")[-1]
                mod_name = base[:-3]
                file_map[base] = name
                if mod_name.isidentifier():
                    module_map[mod_name] = name
    finally:
        _BUNDLE_BUILDING = False
    _BUNDLE_MODULE_MAP = module_map
    _BUNDLE_FILE_MAP = file_map


def _get_module_source(name: str) -> str:
    _build_bundle_maps()
    zip_name = _BUNDLE_MODULE_MAP.get(name)
    if not zip_name:
        raise ModuleNotFoundError("module not in bundle: %s" % name)
    with _open_bundle_zip() as zf:
        data = zf.read(zip_name)
    return data.decode("utf8", errors="replace")


def _get_file_source(filename: str) -> str:
    _build_bundle_maps()
    zip_name = _BUNDLE_FILE_MAP.get(filename)
    if not zip_name:
        raise FileNotFoundError("file not in bundle: %s" % filename)
    with _open_bundle_zip() as zf:
        data = zf.read(zip_name)
    return data.decode("utf8", errors="replace")


class _BundleLoader(importlib.abc.Loader):
    def __init__(self, fullname: str):
        self._fullname = fullname

    def create_module(self, spec):
        return None

    def exec_module(self, module):
        source = _get_module_source(self._fullname)
        code = compile(source, "<bundle:%s>" % self._fullname, "exec")
        module.__file__ = "<bundle:%s>" % self._fullname
        module.__package__ = ""
        exec(code, module.__dict__)


class _BundleFinder(importlib.abc.MetaPathFinder):
    def find_spec(self, fullname, path, target=None):
        if _BUNDLE_BUILDING:
            return None
        _build_bundle_maps()
        if fullname in _BUNDLE_MODULE_MAP:
            return importlib.util.spec_from_loader(fullname, _BundleLoader(fullname))
        return None


def _install_bundle_importer():
    for finder in sys.meta_path:
        if isinstance(finder, _BundleFinder):
            return
    sys.meta_path.insert(0, _BundleFinder())


def _run_module_main(module_name: str, argv):
    _install_bundle_importer()
    prev_argv = sys.argv
    try:
        sys.argv = [module_name] + list(argv)
        module = importlib.import_module(module_name)
        if not hasattr(module, "main"):
            raise RuntimeError("module has no main(): %s" % module_name)
        module.main()
    finally:
        sys.argv = prev_argv


def _run_bundle_file(filename: str, argv):
    _install_bundle_importer()
    prev_argv = sys.argv
    try:
        sys.argv = [filename] + list(argv)
        source = _get_file_source(filename)
        code = compile(source, "<bundle:%s>" % filename, "exec")
        module_globals = {"__name__": "__main__", "__file__": filename}
        exec(code, module_globals)
    finally:
        sys.argv = prev_argv


def _list_bundle_modules():
    _build_bundle_maps()
    mods = sorted(_BUNDLE_MODULE_MAP.keys())
    files = sorted(set(_BUNDLE_FILE_MAP.keys()) - set([name + ".py" for name in mods]))
    return mods, files


def _script_dir() -> str:
    return os.path.dirname(os.path.abspath(__file__))


def _is_local_name(name: str) -> bool:
    return bool(name) and not os.path.isabs(name) and os.path.dirname(name) == ""


def _prompt_local_file(label: str) -> str:
    while True:
        name = input(label).strip()
        if not _is_local_name(name):
            print("[!] Use a filename in the same folder as the script.")
            continue
        path = os.path.join(_script_dir(), name)
        if not os.path.isfile(path):
            print("[!] File not found: %s" % name)
            continue
        return path


def _prompt_local_dir(label: str) -> str:
    while True:
        name = input(label).strip()
        if not _is_local_name(name):
            print("[!] Use a folder name in the same folder as the script.")
            continue
        path = os.path.join(_script_dir(), name)
        if not os.path.isdir(path):
            print("[!] Folder not found: %s" % name)
            continue
        return path


def _batch_encrypt(folder_path: str) -> None:
    inputs = []
    for name in sorted(os.listdir(folder_path)):
        path = os.path.join(folder_path, name)
        if not os.path.isfile(path):
            continue
        ext = os.path.splitext(name)[1].lower()
        if ext in (".py", ".pyc"):
            inputs.append(path)

    if not inputs:
        print("[!] No .py/.pyc files found in that folder.")
        return

    for path in inputs:
        print("[i] encrypt: %s" % os.path.basename(path))
        _run_module_main("encrypt", [path])


def _batch_decrypt(folder_path: str) -> None:
    inputs = []
    skip_ext = {".py", ".pyc", ".out"}
    for name in sorted(os.listdir(folder_path)):
        path = os.path.join(folder_path, name)
        if not os.path.isfile(path):
            continue
        ext = os.path.splitext(name)[1].lower()
        if ext in skip_ext:
            continue
        inputs.append(path)

    if not inputs:
        print("[!] No encrypted files found in that folder.")
        return

    for path in inputs:
        print("[i] decrypt: %s" % os.path.basename(path))
        _run_module_main("decrypt", [path])


def main():
    _install_bundle_importer()
    while True:
        print("\nRAIC Menu")
        print("1. Encrypt")
        print("2. Decrypt")
        print("3. Batch Encrypt")
        print("4. Batch Decrypt")
        print("5. Exit")
        choice = input("Select option: ").strip()

        if choice == "1":
            input_path = _prompt_local_file("Input filename (.py/.pyc): ")
            _run_module_main("encrypt", [input_path])
        elif choice == "2":
            input_path = _prompt_local_file("Input encrypted filename: ")
            _run_module_main("decrypt", [input_path])
        elif choice == "3":
            folder_path = _prompt_local_dir("Folder name to batch encrypt: ")
            _batch_encrypt(folder_path)
        elif choice == "4":
            folder_path = _prompt_local_dir("Folder name to batch decrypt: ")
            _batch_decrypt(folder_path)
        elif choice == "5":
            return
        else:
            print("[!] Invalid selection. Please choose 1-5.")



_BUNDLE_B64 = """

"""
if __name__ == "__main__":
    main()
